import Head from 'next/head'
import React, {FC} from 'react'

interface IButton {
  onClick?: () => void
}

export const Button: FC<IButton> = ({onClick, children}) => {
  return (
    <>
      <button onClick={onClick}>
        {children}
      </button>

      <style jsx>{`
        button {
          padding: 1rem 3rem;
        }
      `}</style>

    </>
  )
}
